import './helpers.mjs';
import './config.mjs';
import { b as registerComponent } from './plugins-8a0db0e9.mjs';
import './Icon-b5486de5.mjs';
import './FormElementMixin-386fdfd0.mjs';
import './Input-fbc105c2.mjs';
import './MatchMediaMixin-6f49ea3f.mjs';
import './trapFocus-dc03669f.mjs';
import './DropdownItem-11ce0987.mjs';
import './Field-5480c2b2.mjs';
import './Select-2e989a42.mjs';
import { s as script } from './Datepicker-20d4648b.mjs';
export { s as ODatepicker } from './Datepicker-20d4648b.mjs';

var index = {
    install(app) {
        registerComponent(app, script);
    }
};

export default index;
